import Merchandise from './Merchandise'

const CheckOut = ({ baskets, substractFromCounter, addToCounter, showCheckOut, totalMoney, currencyRate }) => {
    return (
        <>
            {baskets.map((basket, index) => (
                basket.Count > 0 ?
                    < Merchandise key={index}
                        merchandise={basket}
                        substractFromCounter={substractFromCounter}
                        addToCounter={addToCounter}
                        showCheckOut={showCheckOut}
                        currencyRate={currencyRate}
                    ></Merchandise> : ''
            ))}

            <h4>TotalMoney: {totalMoney.toFixed(2)}</h4>
        </>
    )
}

export default CheckOut
